import {Row, Col} from 'react-bootstrap';
const BoxFeature = () =>{
    return(
        <Row>
            <Col sm={8} md={8} lg={8}>
                sm = 8
            </Col>
            <Col sm={8} md={4} lg={8}>
                sm = 8  
            </Col>
        </Row>
    )
}

export default BoxFeature;
